import React from "react";

import { Route } from "react-router-dom";

// components
import Footer from "../footer/footer";
import Navbar from "./Navbar/Navbarpro";
import Home from "./home/Home";
import SalonPreview from "./salonContainer/salonPreview";
import Listofsalons from "../Geuss/salonssection/hairsalon";
import Profil from "./profil/profilclient";
function Indexclient() {
  return (
    <div>
      <Navbar />
      <Route exact path="/pro">
        <Home />
      </Route>
      <Route path="/pro/listofsalons">hhe</Route>
      <Route path="/pro/monsalon">
        <SalonPreview />
      </Route>
      <Route path="/pro/profil">
        <Profil />
      </Route>
      <Footer />
    </div>
  );
}

export default Indexclient;
